A aquisição consiste em 4 (quatro) aparelhos de ar condicionado do tipo Split, cada um com as seguintes especificações técnicas:
•	Capacidade de refrigeração de 12.000 BTUs;
•	Voltagem de 220V;
•	Modelo compacto e eficiente, adequado para uso em ambientes corporativos;
•	Obrigatoriamente classificados com o Selo Procel de Eficiência Energética, garantindo economia de energia e sustentabilidade;
•	Garantia mínima de 12 meses contra defeitos de fabricação;
•	Tecnologia Inverter preferencialmente, para maior eficiência e menor consumo de energia;
•	Filtros de ar removíveis e laváveis, garantindo melhor manutenção e qualidade do ar interno.
•	Nível de ruído reduzido, adequado para ambientes de trabalho.
Os equipamentos destinam-se à climatização dos gabinetes da Câmara Municipal de Valença, visando oferecer condições adequadas de conforto térmico para o desempenho das atividades institucionais. A exigência do selo de eficiência energética e da tecnologia Inverter está alinhada às boas práticas de sustentabilidade e economia de recursos públicos.

