A execução dos serviços deverá seguir as seguintes diretrizes:
•	Construção e instalação de paredes divisórias em drywall, com estrutura metálica galvanizada, de espessura de 9,5 cm e com altura de 3,9m;
•	Execução de instalação de portas de 90 cm;
•	Fornecimento de materiais necessários, incluindo chapas de gesso, perfis metálicos, parafusos e massas de acabamento;
•	Instalação de isolamento acústico interno com lã de rocha ou similar;
•	Pintura final das paredes após a instalação;
•	Adequação das instalações elétricas e pontos de energia nas divisórias, conforme necessidade identificada;
•	Limpeza e retirada de entulhos após a execução do serviço.

